import { Chart, Tooltip, Axis, Line, Point } from 'viser-react';
import * as React from 'react';

const data = [
  { year: '1991', value: 3 },
  { year: '1992', value: 4 },
  { year: '1993', value: 3.5 },
  { year: '1994', value: 5 },
  { year: '1995', value: 4.9 },
  { year: '1996', value: 6 },
  { year: '1997', value: 7 },
  { year: '1998', value: 9 },
  { year: '1999', value: 13 },
];


const data1 = [{
  type: 'USD',
  value: 340,
  cat: '1960'
}, {
  type: 'BDT',
  value: 20760,
  cat: '办公用品'
}, {
  type: 'USD',
  value: 28750,
  cat: '办公用品'
}, {
  type: 'BDT',
  value: 4090,
  cat: '技术'
}, {
  type: 'USD',
  value: 9880,
  cat: '技术'
}, {
  type: 'BDT',
  value: 40988,
  cat: '技术'
}, {
  type: 'USD',
  value: 14870,
  cat: '家具'
}, {
  type: 'BDT',
  value: 37098,
  cat: '家具'
}, {
  type: 'USD',
  value: 49099,
  cat: '家具'
}];



const scale = [{
  dataKey: 'value',
  min: 0,
},{
  dataKey: 'year',
  min: 0,
  max: 1,
}];

class Reactjs extends React.Component {
  render() {
    return (
      <Chart forceFit height={400} data={data1} scale={scale}>
        <Tooltip />
        <Axis />
        <Line position="year*value" />
        <Point position="year*value" shape="circle"/>
      </Chart>
    );
  }
}
export default Reactjs
